export const selectUser = (user) => {
  console.log("You clicked", user.name);
  return {
    type: "USER_SELECTED",
    payload: user
  }
}

export const removeUser = (user) => {
  console.log("You removed", user.name);
  return {
    type: "USER_REMOVED",
    payload: user
  }
}
